INSERT INTO `Citation` VALUES (1,'L\'art commence avec la retenue','Michel SERRES, philosophe',NULL,'publiée',NULL),(2,'L\'amour aussi !','Marcel Séjour,artiste peintre',NULL,'publiée',1),(3,'La force principale du dessin c’est qu’il contribue à évacuer la peur du noir.\n Et c’est valable pour tout le monde puisque même les Noirs ont peur du noir.','Marcel Séjour',NULL,'publiée',NULL),(4,'Travailler en noir et blanc permet, comme ici à Mayotte,\n de représenter le rustique sans tomber dans le sordide.\nLa couleur est là juste pour faire plaisir ; pas pour rendre compte.','Marcel Séjour',NULL,'publiée',NULL),(5,'Quand je peins un tableau je veux dire quelque chose qui rassure.','Vincent Van Gogh',NULL,'publiée',NULL),(6,'Cette phrase-là, je la prends à mon compte. \n Si je parlais comme je peins, j’aurais plein de femmes et plein d’enfants. \n Denam’neyo','Marcel Séjour',NULL,'publiée',5),(7,'Il faut vingt-cinq ans pour apprendre à dessiner ;\n il faut une semaine pour apprendre à peindre.','Jean Dominique Ingres, peintre français du 19ème siècle',NULL,'publiée',NULL),(8,'Pour avoir Mayotte avec soi, il faut ou la forcer, ou la séduire. On souhaite bien du courage à ceux qui veulent la forcer.','Marcel Séjour',NULL,'publiée',NULL),(9,'Occupe-toi des ombres, et la lumière s’occupera d’elle-même. Voilà un bon précepte de dessinateur.\n Occupe-toi de tes ombres et la lumière s’occupera de toi. Ça doit pouvoir marcher comme ça aussi.','Marcel Séjour',NULL,'publiée',NULL),(10,'L’art est la belle représentation d’une chose et non la représentation d’une belle chose.','Emmanuel Kant',NULL,'publiée',NULL),(11,'Les artistes sont des gens qui ont contact avec toutes les classes sociales\n et qui sont par conséquent ex- trêmement dangereux.\n  Je vous recommande donc d’éviter autant que possible de les fréquenter.','Conseil donné aux membres de sa famille par la reineVictoria.',NULL,'publiée',NULL),(12,'Magnégné, mot mahorais connu de toute la région, qualifiant une action, \nune personne ou une chose, dont la réalisation va de l’approximatif au grand n’importe quoi.','Marcel Séjour',NULL,'publiée',NULL),(13,'Après avoir vécu plus de vingt ans dans les Comores, je suis encore assez souvent surpris par le comportement de leurs habitants,\n et ce qui m’étonne le plus, c’est d’être encore surpris. Je demeure donc un étranger, et c’est très bien comme ça.','Marcel Séjour',NULL,'publiée',NULL),(14,'Les œuvres d’art sont les lettres de noblesse de la seule aristocratie, celle qui a ses ancêtres devant elle.','Rainer Maria Rilke',NULL,'publiée',NULL),(15,'Je n’ai jamais rien lu de Rilke mais je sens que je vais m’y mettre parce qu’une phrase comme celle-là c’est exactement ce que de temps à autre j’ai besoin d’entendre; et de croire.','Marcel Séjour',NULL,'publiée',14),(16,'Ce n’est pas de la beauté, mais c’est de la laideur du monde que nait l’énergie de l’artiste.\n Aux massacres, aux humiliations, aux décompositions, il opposera des harmonies.\n Dérisoires, au regard du vivant, mais indispensables tout de même.','Marcel Séjour',NULL,'publiée',NULL),(17,'Partager ou protéger. C’est le choix auquel l’humanité va de plus en plus être confrontée.\n Jamais choix de survie n’aura été aussi simple.','Marcel Séjour',NULL,'publiée',NULL),(18,'Ici le foyer commence là où se trouve l’enfant ; celle qui le fait, et celle(s) qui l’alimente(nt). \nEn Europe le foyer commence avec le feu ; celui qui le protège et celui qui l’alimente.','Marcel Séjour',NULL,'publiée',NULL),(19,'Faire quelque chose bien, une fois, c’est facile. Faire quelque chose bien deux fois demande une technique considérable.','Marcel Séjour',NULL,'publiée',NULL),(20,'Le style c’est une élégante façon d’arranger ses erreurs.','Marcel Séjour',NULL,'publiée',NULL),(21,'Quand j’étais jeune, j’aurais aimé être riche et ne rien faire d’autre que suivre mon plaisir. \nJe n’ai jamais été riche et c’est ce qui m’a sauvé. \n \n Aujourd’hui je ne veux, ni ne peux, sans doute, rien faire d’autre que peindre. \n Là, maintenant, ce que j’aurais aimé c’est être un meilleur peintre ; mais pas autre chose que peintre.','Marcel Séjour',NULL,'publiée',NULL),(22,'Le plus difficile dans le dessin ? Ne pas se répéter.','Léonard de Vinci',NULL,'publiée',NULL),(23,'On commence au fusain, on continue à la peinture noire (à l\'huile), et on finit avec la couleur.','Marcel Séjour',NULL,'publiée',NULL),(24,'Qu’on en juge ! \nEmpalé sur son roc au cœur du Mozambique, \nL’alizée le menant d’espoirs en désespoirs\n Sisyphe prophétique ou Léviathan lubrique,\nMarcel sur son rocher geint et croque ses Noirs.\n C’est pas du Baudelaire ça ? En tout cas ça y ressemble.\n On aurait ainsi retrouvé à Mayotte le quatrain manquant\nce qui prouverait que le poète a bien séjourné sur l’île.','Marcel Séjour',NULL,'publiée',NULL),(25,'Démarrer est un vrai bonheur. On joue avec l’idée et on est mû par le désir.\nC’est la saison de l’enthousiasme, le printemps en quelque sorte.\nJe passerais volontiers mon temps à démarrer. Après, c’est du boulot, de la recherche, avec ici et là des mini joies, lorsqu’on a trouvé une harmonie satisfaisante.\nFinir, par contre, « demande un cœur d’acier ». ','C’est Ingres qui le dit, et il a bien raison.',NULL,'publiée',NULL),(26,'Quand un sujet m’intéresse il m’arrive de le reprendre, en variant les compositions.','Marcel Séjour',NULL,'publiée',NULL),(27,'Le matriarcat est LA force constitutive de Mayotte ; pas la République.','Marcel Séjour',NULL,'publiée',NULL),(76,'g','g',NULL,'brouillon',2),(77,'g','g',NULL,'publiée',2),(146,'gdfgdfg','dfgdfg',NULL,'brouillon',3);
